import React from 'react';
import s from './Friend.module.css';

const Friend = (props) => {
	let imgUrl = `${props.url}`;

	return (
		<div className={s.friend}>
			<img src={imgUrl} alt=""/>
			<div className="name">
				{props.name}
			</div>
		</div>
	);
};

export default Friend;
